style.css:
@-moz-document url-prefix("https://ytmp3.cc/") {
    body {
        background-color: #201D1C;
    }
    #text {
        color: #c4c2c2;
    }
    #text h1 {
        color: #c4c2c2;
    }
    #converter {
        background-color: #656565;
    }
    #converter #title {
        color: #fff;
    }
    #converter form #input {
        color: #fff;
        background-color: #3b3a3a;
    }
    #converter form {
        background-color: #3e3e3e;
        border: 1px #000 solid;
    }
}
